import { useEffect, useState } from 'react';
import '../components/Context';


function characters({ numb }) {

  const renderCharacters = () => {
      return numb.map((num) => <article key={num.id}>
          <img src={num.image} alt="" />
          <h4>{num.name}</h4>
      </article>)
  }

  return (
      <section>
          {renderCharacters()}
      </section>
  )
}

export default characters
